import { useState } from "react"

const Login = () =>{
    const [isLoginIn, setState] = useState(false);

    const clickLogin = () =>{
        setState(true);
    }


    const clickLogout = () =>{
        setState(false);
    }

    let button;
    if(isLoginIn){
        button = <button onClick={clickLogout}>Logout</button>
    }
    else{
        button = <button onClick={clickLogin}>Login</button>
    }

    return(
        button
    );
}

export default Login;
